anonimo tipografo prese una cassetta di caratteri e li assembl&ograve; per preparare un testo campione. &Egrave; sopravvissuto non solo a pi&ugrave; di cinque secoli, ma anche al passaggio alla videoimpaginazione, pervenendoci sostanzialmente inalterato. Fu reso popolare, negli anni &rsquo;60, con la diffusione dei fogli di caratteri trasferibili &ldquo;Letraset&rdquo;, che contenevano passaggi del Lorem Ipsum, e pi&ugrave; recentemente da software di impaginazione come Aldus PageMaker, che includeva versioni del Lorem Ipsum.</p>','2021-05-31 20:56:15','2021-05-31 20:56:27'),(31,11,'it',NULL,NULL,NULL,NULL,'2021-05-31 20:56:15','2021-05-31 20:56:15'),(32,11,'es',NULL,NULL,NULL,NULL,'2021-05-31 20:56:15','2021-05-31 20:56:15'),(33,11,'fr',NULL,NULL,NULL,NULL,'2021-05-31 20:56:15','2021-05-31 20:56:15');
