INSERT INTO `payment_method_translations` VALUES (1,'en','Paypal','<p>Thank you for ordering.</p>',NULL,'2021-02-14 18:45:03','2021-03-06 09:58:25',1),(2,'it','Paypal','<p>Grazie per aver ordinato.</p>',NULL,'2021-02-14 18:45:03','2021-03-06 09:58:25',1),(3,'es',NULL,NULL,NULL,'2021-02-14 18:45:03','2021-02-14 18:45:03',1),(4,'fr',NULL,NULL,NULL,'2021-02-14 18:45:03','2021-02-14 18:45:03',1),(5,'en','Bank Transfer','<p>Grazie per aver ordinato, di seguito sono indicate le coordinate bancarie necessario per effettuare il bonifico bancario.<br />Per velocizzare i tempi di consegna una volta effettuato il bonifico chiediamo gentilmente di:</p>\r\n<ul class=\"mt-2\">\r\n<li>inviare copia della ricevuta via mail all\'indirizzo <a class=\"text-primary\" href=\"mailto:[order_email]\">[order_email]</a></li>\r\n<li>Indicare nella causale il seguente codice ordine <span class=\"text-accent\">[reference]</span></li>\r\n</ul>\r\n<hr />\r\n<div class=\"my-2\"><span class=\"font-weight-bold\">Intestatario:</span> xxxxxxxxx<br /><span class=\"font-weight-bold\">IBAN:</span> xxxxxx<br /><span class=\"font-weight-bold\">BIC/SWIFT:</span> xxxxxxx<br /><span class=\"font-weight-bold\">Istituto Bancario:</span> xxxxx</div>',NULL,'2021-02-14 18:45:43','2021-03-03 20:01:58',2),(6,'it','Bonifico','<p>Grazie per aver ordinato, di seguito sono indicate le coordinate bancarie necessario per effettuare il bonifico bancario.<br />Per velocizzare i tempi di consegna una volta effettuato il bonifico chiediamo gentilmente di:</p>\r\n<ul class=\"mt-2\">\r\n<li>inviare copia della ricevuta via mail all\'indirizzo <a class=\"text-primary\" href=\"mailto:[order_email]\">[order_email]</a></li>\r\n<li>Indicare nella causale il seguente codice ordine <span class=\"text-accent\">[reference]</span></li>\r\n</ul>\r\n<hr />\r\n<div class=\"my-2\"><span class=\"font-weight-bold\">Intestatario:</span> xxxxxxxxx<br /><span class=\"font-weight-bold\">IBAN:</span> xxxxxx<br /><span class=\"font-weight-bold\">BIC/SWIFT:</span> xxxxxxx<br /><span class=\"font-weight-bold\">Istituto Bancario:</span> xxxxx</div>',NULL,'2021-02-14 18:45:43','2021-03-03 20:01:58',2),(7,'es',NULL,NULL,NULL,'2021-02-14 18:45:43','2021-02-14 18:45:43',2),(8,'fr',NULL,NULL,NULL,'2021-02-14 18:45:43','2021-02-14 18:45:43',2),(9,'en','Cash on delivery','<p>Thanks for ordering, <br />You will pay cash on delivery upon receipt of the goods.</p>','<p>You must have a bank account&nbsp; for an eventual refound</p>','2021-02-14 18:46:36','2021-05-15 12:50:23',3),(10,'it','Contrassegno','<p>Grazie per aver ordinato, <br />Pagerai in contrassegno al ricevimento della merce.</p>','<p>Per un eventuale rimborso &egrave; necessario avere un conto corrente bancario o postale.</p>','2021-02-14 18:46:36','2021-05-15 12:41:07',3),(11,'es',NULL,NULL,NULL,'2021-02-14 18:46:36','2021-02-14 18:46:36',3),(12,'fr',NULL,NULL,NULL,'2021-02-14 18:46:36','2021-02-14 18:46:36',3);
